Provide the SPARQL query based on the given question.

**Question:** Provide the list of patients associated with the payer Dual Eligible.

**SPARQL Query:**

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX syn: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>

SELECT DISTINCT ?first ?last WHERE {
  ?payer a syn:Payer;
        syn:name 'Dual Eligible'^^pl:;
        syn:id ?id.
  ?payerTransition a syn:PayerTransition;
        syn:patientId ?patientId.
  ?patient a syn:Patient;
        syn:id ?patientId;
        syn:first ?first;
        syn:last ?last.
}
```
